DROP TABLE IF EXISTS `tb_student`;
CREATE TABLE `tb_student`  (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT '学生Id',
  `name` varchar(30) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '学生姓名',
  `grade` int NULL DEFAULT NULL COMMENT '学生年级',
  `specialities` varchar(30) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '学生专业',
  `stu_class` varchar(30) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '学生班级',
  `student_id` varchar(30) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '学生学号',
  `password` varchar(30) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '学生密码',
  `phone` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '学生手机号',
  `email` varchar(30) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '学生邮箱',
  `qq` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '学生qq',
  `title` varchar(40) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '论文题目',
  `language` varchar(10) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '撰写语言',
  `research_direction` varchar(30) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '论文研究方向',
  `thesis_keyword` varchar(500) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '论文关键词',
  `is_first_session` tinyint(1) NULL DEFAULT NULL COMMENT '是否第一届毕业生 0表示否 1表示是',
  `thesis_type` varchar(30) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '论文类型',
  `file` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '论文文件',
  `file2` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '论文文件2',
  `file3` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '论文文件3',
  `nature_topic_selection` tinyint(1) NULL DEFAULT NULL COMMENT '选题性质 1理论研究 2应用研究 3技术开发 4工程设计',
  `source_topic_selection` tinyint(1) NULL DEFAULT NULL COMMENT '选题来源 1指定选题 2自拟选题',
  `is_complete_practice` tinyint(1) NULL DEFAULT NULL COMMENT '是否完成实践 0表示否  1表示是',
  `mentor_id` bigint NULL DEFAULT NULL COMMENT '指导教师Id',
  `mentor2_id` bigint NULL DEFAULT NULL COMMENT '指导教师2Id',
  `mentor_score` int NULL DEFAULT NULL COMMENT '指导教师评分',
  `appraiser_score` int NULL DEFAULT NULL COMMENT '评阅老师评分',
  `defense_score` int NULL DEFAULT NULL COMMENT '答辩小组评分',
  `comprehensive_score` int NULL DEFAULT NULL COMMENT '综合评分',
  `evaluation_grade` tinyint(1) NULL DEFAULT NULL COMMENT '评价等级 1优秀 2良好 3合格 4不合格',
  `repetition_rate` int NULL DEFAULT NULL COMMENT '论文重复率',
  `notes` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '备注',
  `notes2` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '备注2',
  `notes3` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '备注3',
  `notes4` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '备注4',
  `notes5` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '备注5',
  `gmt_create` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `gmt_modified` datetime NULL DEFAULT NULL COMMENT '修改时间',
  `gender` varchar(10) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '学生性别',
  `age` tinyint NULL DEFAULT NULL COMMENT '学生年龄',
  `is_selected` tinyint NULL DEFAULT NULL COMMENT '学生是否被选择 0 否 1 是',
  PRIMARY KEY (`id`, `student_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 554 CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci ROW_FORMAT = COMPACT;

